        /// <summary>
        /// The _instance
        /// </summary>
        private static CityStorage _instance;

        /// <summary>
        /// The _lock
        /// </summary>
        private static object _lock = new object();

        /// <summary>
        /// Initializes a new instance of the <see cref="CityStorage"/> class.
        /// </summary>
        public CityStorage()
        {
            this.InitStorage();
        }
        
        /// <summary>
        /// Gets the instance on singleton.
        /// </summary>
        /// <value>
        /// The instance.
        /// </value>
        public static CityStorage Instance
        {
            get
            {
                lock (_lock)
                {
                    if (_instance == null)
                    {
                        _instance = new CityStorage();
                    }

                    return _instance;
                }
            }
        }

        /// <summary>
        /// The _city dictionary
        /// </summary>
        private Dictionary<int, ISearchableItem> _cityDictionary;

        /// <summary>
        /// Finds the specified keys.
        /// </summary>
        /// <param name="keys">The keys.</param>
        /// <returns>List of strings</returns>
        public List<string> Find(int[] keys)
        {
            if (keys == null)
            {
                return null;
            }

            List<string> result = new List<string>();
            ISearchableItem value;
            foreach (int key in keys)
            {
                if (this._cityDictionary.TryGetValue(key, out value))
                {
                    result.Add(value.Name);
                }
            }

            return result;
        }

        /// <summary>
        /// Gets the data.
        /// </summary>
        /// <returns>
        /// Dictionary id and items
        /// </returns>
        public Dictionary<int, ISearchableItem> GetData()
        {
            return this._cityDictionary;
        }

